);
class App extends Component {

  render() {
    return (
      <BrowserRouter>
      <div className='main'>
        <Header />
          <Mainmessage />
            <Sarchbar />
            <Buttun />
      </div>
      <Route exact path='/skiarea' component={Skiarea_list} />
      </BrowserRouter>
    );
  }
}

export default App;
